import React from 'react';
import "../Navigation/Navigation.scss"
import logo from '../../assets/logo.svg'
import cart from '../../assets/cart.svg'
class Navigation extends React.Component{
    render(){
        return(
            <div>
          
{/* <img src={logo} className="logo img-responsive" alt="dea-alright logo"/> */}

<nav className="navbar navbar-light ">
  <a className="navbar-brand" href="#">
    <img src={logo} width="100" height="100" alt="dea-alright logo"/>
  </a>
  <img src={cart} className="shopping-cart" alt="shopping-bag" />
  <button type="button" class="btn btn-primary btn-lg">LOGIN/SIGNUP</button>
</nav>

            </div>
        )
    }
}

export default Navigation
